graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  subgraph cluster_Parent {
    label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>Parent</b></td></tr></table>>;
    labelloc="t";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    "Parent__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    "Process" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Process</b> <i>&lt;task&gt;</i></td></tr><tr><td align="left">Parent's process</td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];

    "note_Parent_0" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>, shape=note, fillcolor="#FFFACD", style=filled, fontsize=9];
    "note_Parent_0" -> "Parent__cluster_anchor" [style=dashed, color="#999999", arrowhead=none];
    "note_Process_0" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left">Documentation for qualified process</td></tr></table>>, shape=note, fillcolor="#FFFACD", style=filled, fontsize=9];
    "note_Process_0" -> "Process" [style=dashed, color="#999999", arrowhead=none];
  }
  "Start" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Start</b></td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];

  // Edges
  "Start" -> "Process" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Process" -> "Process" [labelOverlay="75%", labelhref="#srcLineTBD"];
}
